// app/javascript/components/AboutUs.js
import React from 'react';
import { Link } from 'react-router-dom';

const AboutUs = () => {
  return (
    <div>
      <h1>This is the About page</h1>
      <Link to="/hello">Go to Home</Link>
    </div>
  );
}

export default AboutUs;
